import React from 'react' 
import { Chat } from 'react-chat-popup';
import { Modal} from 'react-bootstrap'

const Chats = (props) => {
    return (
        <div>
            <Modal {...props}>

            <Chat />
          </Modal>
        </div>
    )
}

export default Chats
